<?php
session_start();

// accessed collections from the database 
include "../../../connectDatabase.php";
$folders = $db->folders;
$accounts = $db->accounts;
$studentAccounts = $db->studentAccounts;
$teacherAccounts = $db->teacherAccounts;

// whenever folder is clicked update variables and get inside of it
if (isset($_GET["clickedfolder"])) {
    $parentFolderId = $_GET["clickedfolder_id"];
    $parentFolderName = $_GET["clickedfolder_name"];
    $_SESSION['path'] = $_SESSION['path'] . "-" . $parentFolderId;
    $_SESSION['pathNames'] = $_SESSION['pathNames'] . "-" . $parentFolderName;
    $_SESSION['parent_id'] = new MongoDB\BSON\ObjectID($parentFolderId);
}

// for navigating to previous folders in path . Here also variables will be updated
if (isset($_GET['previous'])) {
    $parentFolderId = $_GET["previous_id"];
    $path = explode("-", $_SESSION['path']);
    $pathNames = explode("-", $_SESSION['pathNames']);
    $tmp_path = array();
    $tmp_pathNames = array();
    foreach ($path as $key => $value) {
        array_push($tmp_path, $value);
        array_push($tmp_pathNames, $pathNames[$key]);
        if ($value == $parentFolderId) {
            break;
        }
    }
    $_SESSION['path'] = join("-", $tmp_path);
    $_SESSION['pathNames'] = join("-", $tmp_pathNames);
    $_SESSION['parent_id'] = new MongoDB\BSON\ObjectID($parentFolderId);
}
$clg_id = $_SESSION["adminid"];
$parentFolderId = $_SESSION['parent_id'];
$path = explode("-", $_SESSION['path']);
$pathNames = explode("-", $_SESSION['pathNames']);

// delete action for the course
include "deleteCourse.php";

?>
